using System;\nusing System.Collections.Generic;\nusing System.Xml.XPath;\n\npublic class CustomXPathNavigator : XPathNavigator\n{\n    private List<object> data;\n    private int position;\n\n    public CustomXPathNavigator(List<object> data)\n    {\n        this.data = data;\n        this.position = 0;\n    }\n\n    public override XPathNodeType NodeType\n    {\n        get { return XPathNodeType.Element; }\n    }\n\n    public override string LocalName\n    {\n        get { return "item"; }\n    }\n\n    public override string NamespaceURI\n    {\n        get { return string.Empty; }\n    }\n\n    public override string Prefix\n    {\n        get { return string.Empty; }\n    }\n\n    public override string Value\n    {\n        get { return data[position].ToString(); }\n    }\n\n    public override int Count\n    {\n        get { return data.Count; }\n    }\n\n    public override XPathNavigator Clone()\n    {\n        return new CustomXPathNavigator(data);\n    }\n\n    public override bool MoveToFirstChild()\n    {\n        if (position < data.Count)\n        {\n            position = 0;\n            return true;\n        }\n        return false;\n    }\n\n    public override bool MoveToNext()\n    {\n        if (position < data.Count - 1)\n        {\n            position++;\n            return true;\n        }\n        return false;\n    }\n\n    public override bool MoveToPrevious()\n    {\n        if (position > 0)\n        {\n            position--;\n            return true;\n        }\n        return false;\n    }\n\n    public override bool MoveTo(XPathNavigator other)\n    {\n        // Not implemented\n        throw new NotImplementedException();\n    }\n}